'  exception',
'    when NO_DATA_FOUND then l_result := ''N'';',
'  end;',
' ',
'  begin',
'    select 1 into l_qres',
'    from all_objects',
'    where object_name=''WWV_FLOW_SPATIAL_API'' and object_type=''PACKAGE'' and rownum = 1;',
'  exception',
'    when NO_DATA_FOUND then l_result := ''N'';',
'  end;',
